Performer.create!([
  {name: "Joe Rogan", description: "Joe Rogan is an American stand-up comedian, podcaster, and color commentator. He is also a former actor, host, and mixed martial artist but is perhaps best known for his podcast titled The Joe Rogan Experience, performing stand-up comedy, color commentating for the Ultimate Fighting Championship (UFC), and hosting former reality shows Fear Factor and Joe Rogan Questions Everything.", image: "https://pbs.twimg.com/profile_images/552307347851210752/vrXDcTFC.jpeg"},
  {name: "Ari Shaffir", description: "Ari Shaffir is an actor and producer, known for InAPPropriate Comedy (2013), Ari Shaffir: Paid Regular (2015) and Chronic-Con, Episode 420: A New Dope (2015).", image: "http://judygold.com/wp-content/uploads/2015/12/Ari-Shaffir1.jpg"},
  {name: "Louis CK", description: " Louis C.K. is an American comedian, actor, writer, producer, director, and editor. He is the creator, star, writer, director, executive producer, and primary editor of the acclaimed FX comedy-drama series Louie. C.K. is known for his use of observational, self-deprecating, dark and vulgar humor in his stand-up career.", image: "http://www.austinchronicle.com/binary/1157/scaled.louisck.png"},
  {name: "Sam Kinison", description: "Sam Kinison, an American stand-up comedian and actor. He was known for his intense, harsh and politically incorrect humor. A former Pentecostal preacher, he performed stand-up routines that were most often characterized by an intense style, similar to charismatic preachers, and punctuated by his trademark scream.", image: "http://www.champcomedyblog.com/wp-content/uploads/2013/11/KINISON.jpg"},
  {name: "Bill Hicks", description: "Bill Hicks, an American stand-up comedian, social critic, satirist, and musician. His material, encompassing a wide range of social issues including religion, politics, and philosophy, was controversial, and often steeped in dark comedy. He criticized consumerism, superficiality and banality within the media and popular culture, which he characterized as oppressive tools of the ruling class that keep people \"stupid and apathetic\".", image: "http://myspiltmilk.com/sites/default/files/main-image/untitled-1.jpeg"},
  {name: "Bill Burr", description: "Bill Burr is an American comedian, writer, and actor. He is best known for his stand-up comedy specials. He is also known for being the host of Bill Burr's Monday Morning Podcast, playing Patrick Kuby in the AMC crime drama series Breaking Bad, and starring in the Netflix animated sitcom F Is for Family as Frank Murphy. In 2013, The New York Times wrote that Burr \"has been one of the funniest, most distinctive voices in the country for years.\"", image: "http://www.thewrap.com/wp-content/uploads/2014/12/Bill-Burr-Netflix-special.jpg"},
  {name: "Tom Segura", description: "Tom Segura is an American comedian from Cincinnati, Ohio. He currently lives in Los Angeles, California.", image: "http://tomseguracom.ipage.com/wp-content/uploads/2014/03/TOM_Slide_face.jpg"}
])
