Venue.create!([
  {name: "Usher Hall", description: "The Usher Hall is a 5 star concert hall, situated on Lothian Road, in the west end of Edinburgh, Scotland. It has hosted concerts and events since its construction in 1914 and can hold approximately 2,200 people in its recently restored auditorium, which is well loved by performers due to its acoustics. The Hall is flanked by The Royal Lyceum Theatre on the right and The Traverse Theatre on the left. Historic Scotland has registered the Hall with Category A listed building status.", image: "http://s0.geograph.org.uk/photos/14/99/149973_48fb27a0.jpg", location: "Lothian Road", capacity: nil},
  {name: "Kings Theatre", description: "The King's Theatre was opened in 1906 and stands on a prominent site on Leven Street in Edinburgh. It is one of Scotland's historic and most important theatres. It plays a vital role in today's theatre industry as much as it has done in its 100 years of service to Edinburgh theatre patrons.", image: "http://www.theatresonline.com/theatres/edinburgh-theatres/the-kings-theatre/images/kings-theatre.jpg", location: "2 Leven St, Edinburgh EH3 9LQ", capacity: nil},
  {name: "Gilded Balloon", description: "The Gilded Balloon is one of the Edinburgh Festival Fringe's best-known venues, established by Karen Koren in 1986 in Edinburgh's Cowgate. When a fire destroyed the original premises, Teviot Row House in Bristo Square became the Gilded Balloon's main venue.", image: "http://www.gildedballoon.co.uk/wp-content/uploads/2014/07/GB-crop.jpg", location: "25 Greenside Ln, Edinburgh EH1 3AA, United Kingdom", capacity: nil},
  {name: "Assembly Rooms", description: "The Assembly Rooms are in central Edinburgh. Originally solely a meeting place for social gatherings, it is now also used as an arts venue and for public events, including the Edinburgh Festival Fringe and the Hogmanay celebrations. There are four rooms that are used year-round and are available for private functions: Music Hall, Ballroom, Supper Room and Edinburgh Suite. The building is protected as a category A listed building as \"an outstanding example of the late 18th century public building, continuing its original use\"", image: "http://www.edinburgharchitecture.co.uk/images/jpgs/assembly-rooms-edinburgh-p120613-p2.jpg", location: "54 George St, Edinburgh EH2 2LR, United Kingdom", capacity: nil},
  {name: "Pleasance Dome", description: "Since 2000 the Pleasance Dome has been the hub of the now-famous Bristo Square, with the best comedy and theatre in 5 venues all under one roof. The legendary Pleasance atmosphere runs late in to the night.", image: "https://c2.staticflickr.com/6/5539/12524175273_b00b4a0acd_b.jpg", location: "Pleasance Dome, 1 Bristo Pl, Edinburgh EH8 9AL, United Kingdom", capacity: nil},
  {name: "Assembly on the Mound", description: "The magnificent venue atop the Mound is the most prestigious venue on the Fringe and hosts the finest drama, music and comedy. Entrance and box office through New College Quad off Mound Place. The venue houses three spaces; the Main Hall, Rainy Hall and Baillie Room.", image: "http://ispneconference.com/wp-content/uploads/2014/09/Assembly.jpg", location: "Mound Place, EH1 2LU", capacity: nil}
])
